            "text": "/**\r\n * Interface for the Plugin to access functions managed by WUPOS. This would be\r\n * hosted and maintained by WUPOS and included via a <SCRIPT> tag in WUPOS when\r\n * the Plugin is enabled in ARC+. This could be initially developed by VML.\r\n */\r\nPluginHost = {\r\n    pingInterval : 1000 * 60 * 3,\r\n\t//pingInterval:1000 * 5,\r\n\t/**\r\n\t * Function to keep the WUPOS session alive.\r\n\t *\r\n\t * Here is a sample implementation. With this approach, the plugin will call\r\n\t * this method everytime it makes a call to the Plugin backend. The method\r\n\t * will limit 1 request every 3 minutes to reduce load.\r\n\t */\r\n\tping: function() {\r\n\t\t// Time interval to allow pings = 3 minutes\r\n\t\t//PluginHost.pingInterval = 1000 * 60 * 3;\r\n\t\tif(typeof PluginHost.lastPing == \"undefined\"\r\n\t\t\t\t|| PluginHost.lastPing + PluginHost.pingInterval < new Date().getTime()) {\r\n\r\n\t\t\t// Update the last ping time\r\n\t\t\tPluginHost.lastPing = new Date().getTime();\r\n\t\t\t// Make the ajax request to the server to update the server session timeout\r\n\t\t\tTapestry.ajaxRequest(\"/agent-app/home.agentdefaultlayout.resettimer\", {\r\n\t\t\t\tonSuccess: function() {\r\n\t\t\t\t\t// Reset the WUPOS client-side counter to delay the timeout message\r\n\t\t\t\t\tFexLink.SessionTimeout.reset();\r\n\t\t\t\t}\r\n\t\t\t});\r\n\t\t}\r\n\t}\r\n\r\n};\r\n"
