            "text": "define(['pp', 'model/BigDecimal', 'lib/underscore'], function(pp, BigDecimal, _) {\n\tfunction Money() { this.init.apply(this, arguments); }\n\t_.extend(Money.prototype, BigDecimal.prototype, {\n\t\t/**\n\t\t * Creates a new money object.\n\t\t * @param {Double} amount the money amount in the given currency\n\t\t * @param {String} currency the currency code associated with the amount\n\t\t * @param {CurrencyConverter} [fx] optional parameter to define the currency converter\n\t\t */\n\t\tinit: function(amount, currency, fx) {\n\t\t\tBigDecimal.prototype.init.call(this, amount, 2);\n\t\t\tthis.currency = currency || pp.vars.agent.currency;\n\t\t\tthis.fx = fx;\n\t\t},\n\t\t/**\n\t\t * Returns the unformatted amount in the specified currency.\n\t\t * @return {double} the converted amount.\n\t\t */\n\t\tamt: function(currency) {\n\t\t\tif(!currency || this.currency === currency) { return this.amount; }\n\t\t\treturn this.getFx().convert(this.amount, this.currency, currency);\n\t\t},\n\t\tgetFx: function() { return this.fx || pp.fx; },\n\t\tgetRate: function() { return this.getFx().getRate(this.currency); },\n\t\t/**\n\t\t * Returns a money object in the given currency\n\t\t * @return {Money} the converted amount.\n\t\t */\n\t\texchange: function(currency) {\n\t\t\tif(!currency || this.currency === currency) { return this; }\n\t\t\treturn new Money(this.amt(currency), currency, this.fx);\n\t\t},\n\t\t/**\n\t\t * Formats the number with the currency. If the specified currency is\n\t\t * different than the currency of the number, it will be converted using\n\t\t * pp.utils.convert.\n\t\t * @param {String} [currency] the desired currency. If omitted, use current.\n\t\t * @param {boolean} [suppressCurrency] designates if the currency\n\t\t *\t\tshouldn't be appended.\n\t\t * @return {String} the formatted value.\n\t\t */\n\t\tformat: function(currency, suppressCurrency) {\n\t\t\tvar c = (typeof currency === \"string\") ? currency : this.currency,\n\t\t\t\tnoCurrency = (typeof currency === \"boolean\") ? currency : (suppressCurrency === true),\n\t\t\t\tamt = this.exchange(c),\n\t\t\t\tsuffix = (noCurrency) ? \"\" : \" \" + c;\n\n\t\t\treturn BigDecimal.prototype.format.call(amt) + suffix;\n\t\t},\n\t\t/** Clones a version of the money object. Note: it uses a reference to the converter. Potentially need a **deep** argument to indicate creating a new instance. **/\n\t\tclone: function() {\n\t\t\treturn new Money(this.amount, this.currency, this.fx);\n\t\t}\n\t});\n\t/** Sums all the money in the currency of the first item. This can either be an array or separate arguments. */\n\tMoney.sum = function(values) {\n\t\tvar _values = _.isArray(values) ? values : arguments, total, vlen = _values.length, v;\n\t\tif(vlen === 0) { return new Money(); }\n\t\ttotal = _values[0].clone();\n\t\tfor(v=1; v<vlen; ++v) { total.amount += _values[v].amt(total.currency); }\n\t\treturn total;\n\t};\n\t\n\treturn Money;\n});"
