            "text": "define(['model/Money', 'lib/underscore'], function(Money, _) {\n\t/** Allows for pre-converted amounts. */\n\tfunction FixedMoney() { this.init.apply(this, arguments); }\n\t_.extend(FixedMoney.prototype, Money.prototype, {\n\t\t/**\n\t\t * Creates a new fixed money object.\n\t\t * @param {Double} amount the money amount in the given currency\n\t\t * @param {String} currency the currency code associated with the amount\n\t\t * @param {CurrencyConverter} [fx] optional parameter to define the currency converter\n\t\t */\n\t\t//init: function(amount, currency, fx) {\n\t\tinit: function(amount, currency, conversions, fx) {\n\t\t\tMoney.prototype.init.call(this, amount, currency, fx);\n\t\t\tthis.conversions = conversions || {};\n\t\t},\n\t\tamt: function(currency) {\n\t\t\tif(!currency || this.currency === currency) { return this.amount; }\n\t\t\tvar conversion = this.conversions[currency];\n\t\t\tif(typeof conversion === \"undefined\") {\n\t\t\t\treturn Money.prototype.amt.call(this, currency);\n\t\t\t} else {\n\t\t\t\treturn conversion;\n\t\t\t}\n\t\t}\n\t});\n\t\n\treturn FixedMoney;\n});"
