            "compression": 0,
            "text": "define(function() {\n\tfunction CurrencyConverter(exchangeRates, sourceCurrency) {\n\t\t/** Holds the exchange rates as key=currencyCode, value=exchangeRate **/\n\t\tthis.rate = exchangeRates || {};\n\t\t/** The source currency the exchange rates are based on. **/\n\t\tthis.src = sourceCurrency || null;\n\t\t/** Retrieves the exchange rate for the given currency. If not defined, returns 1. */\n\t\tthis.getRate = function(currency) {\n\t\t\treturn this.rate[currency] || 1;\n\t\t},\n\t\t/** Converts the amount from the from currency to the to currency. */\n\t\tthis.convert = function(amount, from, to) {\n\t\t\tif(from === to) { return amount; }\n\t\t\tif(from === this.src) { return this.to(amount, to); }\n\n\t\t\tvar _amount = this.from(amount, from);\n\t\t\treturn (to !== this.src) ? this.to(_amount, to) : _amount;\n\t\t};\n\t\t/** Converts **TO** the currency given from the source currency. **/\n\t\tthis.to = function(amount, currency) { return amount / this.getRate(currency); };\n\t\t/** Converts **FROM** the currency given to the source currency. **/\n\t\tthis.from = function(amount, currency) { return amount * this.getRate(currency); };\n\t}\n\t\n\treturn CurrencyConverter;\n});"
