            "text": "define(['pp', 'lib/jquery'], function(pp, $) {\n\treturn {\n\t\tstart: function(context) {\n\t\t\tconsole.debug(\"dashboard start\");\n\t\t\tcontext.vars.steps = 0;\n\n\t\t\t// FIXME Remove this once ppObject is no longer required\n\t\t\tcontext.vars.ppObject = {};\n\t\t},\n\t\tstates: {\n\t\t\tcheckHandover: {\n\t\t\t\taction: function(context) {\n\t\t\t\t\tcontext.vars.isHandover = !$.isEmptyObject(pp.vars.mtcn);\n\t\t\t\t\tif(context.vars.isHandover) {\n\t\t\t\t\t\tcontext.vars.tx = $.extend(context.vars.tx, { sourceOfFunds:'mtcn' });\n\t\t\t\t\t\t// Kind of hoaky, but context isn't available when the handover is received\n\t\t\t\t\t\tcontext.vars.mtcn = pp.vars.mtcn;\n\t\t\t\t\t}\n\t\t\t\t\treturn context.vars.isHandover;\n\t\t\t\t},\n\t\t\t\tyes: \"handover\",\n\t\t\t\tno: \"home\"\n\t\t\t},\n\t\t\t\n\t\t\thandover: {\n\t\t\t\taction: function(context) {\n\t\t\t\t\tvar sellable = pp.vars.agent.actions.sellACardMTCN,\n\t\t\t\t\t\tloadable = pp.vars.agent.actions.mtcnLoad;\n\n\t\t\t\t\tif(sellable) {\n\t\t\t\t\t\tsellable = false;\n\t\t\t\t\t\t$(pp.vars.agent.products).each(function(index, product) {\n\t\t\t\t\t\t\tif(product.actions.sellACardMTCN) {\n\t\t\t\t\t\t\t\tsellable = true;\n\t\t\t\t\t\t\t\treturn false;\n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t});\n\t\t\t\t\t}\n\t\t\t\t\t\n\t\t\t\t\tif(!sellable || !loadable) {\n\t\t\t\t\t\treturn (sellable) ? \"sellACard\" : (loadable) ? \"loadFunds\" : \"invalid\";\n\t\t\t\t\t} else {\n\t\t\t\t\t\treturn 'chooseTransaction';\n\t\t\t\t\t}\n\t\t\t\t},\n\t\t\t\ton: {\n\t\t\t\t\tchooseTransaction:'chooseTransaction',\n\t\t\t\t\tsellACard:'sellACard',\n\t\t\t\t\tloadFunds:'loadFunds'\n\t\t\t\t}\n\t\t\t},\n\t\t\tchooseTransaction: {\n\t\t\t\tview: \"chooseTransaction\",\n\t\t\t\trender: function(context) { $('#pp-container-header-overlay-flow').hide(); },\n\t\t\t\tvalidate: function(context, $view) { console.log('chooseTransaction.validate');return pp.validation.validate(context, $view); },\n\t\t\t\texit: function(context) { $('#pp-container-header-overlay-flow').show(); },\n\t\t\t\ton: {\n\t\t\t\t\tnext: function(context) { return context.$view.find('.pp-radio[name=ppTransactionType]:checked').val(); }\n\t\t\t\t}\n\t\t\t},\n\t\t\thome: {\n\t\t\t\tview: \"dashboard\",\n\t\t\t\tenter: function(context) {\n\t\t\t\t\t$('.pp-no-dashboard').hide();\n\t\t\t\t},\n\t\t\t\tload: function(context) {\n\t\t\t\t\tvar ids = [];\n\t\t\t\t\tif(pp.vars.agent.actions.cashLoad) { ids.push('#loadFundsFlow'); }\n\t\t\t\t\tif(pp.vars.agent.actions.buyACard || pp.vars.agent.actions.sellACardMTCN) {\n\t\t\t\t\t\tids.push('#sellACardFlow');\n\t\t\t\t\t}\n\t\t\t\t\tif(pp.vars.agent.actions.cashOff) { ids.push('#withdrawFundsFlow'); }\n\t\t\t\t\tif(pp.vars.agent.actions.checkBalance) { ids.push('#checkBalanceFlow'); }\n\t\t\t\t\tif(pp.vars.agent.actions.reloadPlus) { ids.push('#reloadPlusFlow'); }\n\n\t\t\t\t\t$('.pp-mainpage-buttons').not(ids.join(',')).hide();\n\t\t\t\t},\n\t\t\t\ton: {\n\t\t\t\t\twithdrawFunds: \"withdrawFunds\",\n\t\t\t\t\tloadFunds: \"loadFunds\",\n\t\t\t\t\tsellACard: \"sellACard\",\n\t\t\t\t\tcheckBalance: \"checkBalance\",\n\t\t\t\t\tintegration: \"integration\",\n\t\t\t\t\treloadPlus: \"reloadPlus\"\n\t\t\t\t}\n\t\t\t},\n\t\t\twithdrawFunds: {\n\t\t\t\tsubflow: \"withdrawFunds\",\n\t\t\t\tto: \"home\"\n\t\t\t},\n\t\t\tloadFunds: {\n\t\t\t\tsubflow: \"loadFunds\",\n\t\t\t\tto: \"home\"\n\t\t\t},\n\t\t\tsellACard: {\n\t\t\t\tsubflow: \"sellACard\",\n\t\t\t\tto: \"home\"\n\t\t\t},\n\t\t\tcheckBalance: {\n\t\t\t\tsubflow: \"checkBalance\",\n\t\t\t\tto: \"home\"\n\t\t\t},\n\t\t\tintegration: {\n\t\t\t\tsubflow: \"integration\",\n\t\t\t\tto: \"home\"\n\t\t\t},\n\t\t\treloadPlus: {\n\t\t\t\tsubflow: \"reloadPlus\",\n\t\t\t\tto: \"home\"\n\t\t\t}\n\t\t},\n\t\tglobal: {\n\t\t\tnext: $.flow.globalNext,\n\t\t\tback: {\n\t\t\t\tto: pp.breadcrumbListener.back,\n\t\t\t\tnoValidate: true\n\t\t\t}\n\t\t}\n\t};\n});\n"
